import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Route,
  Routes,
} from "react-router-dom";
import Login from "./components/Login";


function App() {
  return (
    <Router>
     <Route exact path="/" component={Login}/>
    </Router>
   );
 }

export default App;
